import React from 'react';
import { BrowserRouter as Router, Routes, Route, useNavigate } from 'react-router-dom';
import './styles/App.css';

// Welcome Page Component
const WelcomePage: React.FC = () => {
  const navigate = useNavigate();
  console.log('WelcomePage updated');

  const handleBills = () => navigate('/bills');
  const handleCongressman = () => navigate('/congressman');

  return (
    <div className="page">
      <h2>Welcome Page</h2>
      <p>This is the updated welcome page text.</p>
      <div className="navigation">
        <button className="button" onClick={handleBills}>Go to Bills Page</button>
        <button className="button" onClick={handleCongressman}>Go to Congressman Page</button>
      </div>
    </div>
  );
};

// Bills Page Component
const BillsPage: React.FC = () => {
  const navigate = useNavigate();
  console.log('BillsPage updated');

  const handleBack = () => navigate('/');

  return (
    <div className="page">
      <h2>Bills Page</h2>
      <p>This is the bills page.</p>
      <div className="navigation">
        <button className="button" onClick={handleBack}>Back to Welcome Page</button>
      </div>
    </div>
  );
};

// Congressman Page Component
const CongressmanPage: React.FC = () => {
  const navigate = useNavigate();
  console.log('CongressmanPage updated');

  const handleBack = () => navigate('/');

  return (
    <div className="page">
      <h2>Congressman Page</h2>
      <p>This is the congressman page.</p>
      <div className="navigation">
        <button className="button" onClick={handleBack}>Back to Welcome Page</button>
      </div>
    </div>
  );
};

// App Component
const App: React.FC = () => {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>SwampHacks 2025</h1>
        </header>
        <main>
          <Routes>
            <Route path="/" element={<WelcomePage />} />
            <Route path="/bills" element={<BillsPage />} />
            <Route path="/congressman" element={<CongressmanPage />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
};

export default App;
